void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord / iResolution.y, s = vec2(.0),c = vec2(.0);    
    vec2 f = fragCoord.xy;
    float k = uv.x;
    float t = iTime * 0.3;
    t+=sin(t*10.)*0.1;
    f.y += 233.0;
    float d = floor(uv.x * 10.0) + 0.5;
    f.y+=uv.x*5000.0*(floor(mod(d,2.0)-1.0)+0.5);
    float g = d * 20.0;
    f.y += 1233.0 * g * t*.05;
    k = sin(f.y / g);
    k = floor(k+1.0);
    fragColor = vec4(k);
}
